css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("stackoverflow.com"), domain("stackexchange.com"), domain("mathoverflow.net") {
  body {
    background: black;
  }
  .container {
    background: none;
    box-shadow: none;
  }
  pre, code, #content {
    background: none;
  }
  blockquote {
    background: #222;
  }
  
  body, #question-header .question-hyperlink {
    color: lightgrey;
  }
  
  .pln {
    color: lightgrey;
  }
  .pun {
    color: grey;
  }
  .kwd {
    color: cyan;
  }
  .str {
    color: green;
  }
  .lit {
    color: violet;
  }
  
  .tag {
    color: yellow;
  }
  .atn {
    color: lightgreen;
  }
  .atv {
    color: pink;
  }
  
  .dec {
    color: grey;
  }
}
